import { IgrStackedBarSeries } from "./igr-stacked-bar-series";
import { Stacked100BarSeries } from "./Stacked100BarSeries";
/**
 * Represents a IgxDataChartComponent stacked100 bar series.
*/
export class IgrStacked100BarSeries extends IgrStackedBarSeries {
    createImplementation() {
        return new Stacked100BarSeries();
    }
    /**
                                 * @hidden
                                 */
    get i() {
        return this._implementation;
    }
    constructor(props) {
        super(props);
    }
    get isPercentBased() {
        return this.i.aa4;
    }
}
